import { BrowserRouter, Link, Route, Routes,Redirect } from 'react-router-dom';
import './App.css';
import { Login } from './components/Login/Login';
import Register from './components/Register/Register'
import {Admin} from './components/Home/Admin'
import {User}from './components/Home/User'
import {Driver} from  './components/Home/Driver'
import {useSelector} from 'react-redux'
import { useEffect } from 'react';
function App() {

  const loggeduser=useSelector(state=>state.authentic.loggeduser);
  const token=useSelector(state=>state.authentic.tokenlog);

  useEffect(()=>{
    if(token){
      if(loggeduser.role_id===1){
        window.location.href='/admin/home'
      }
      if(loggeduser.role_id===2){
        window.location.href='/driver/home'
      }
      if(loggeduser.role_id===3){
        window.location.href='/user/home'
      }
    }
  },[token])
  return (
    <div className="App">
     <BrowserRouter>

     <Routes>
       <Route path="/admin/home" element={<Admin/>} />
        <Route path="/driver/home" element={<Driver/>}/>

        <Route path='/register' element={<Register/>}/>
        <Route exact path='' element={<Login/>}/>
        <Route exact path='/login' element={<Login/>}/>
        <Route exact path='/' element={<Login/>}/>
        <Route exact path='/user/home' element={loggeduser.role_id===3?<User/>:<Login/>}/>
     </Routes>
     </BrowserRouter>
    </div>
  );
}

export default App;
